var sumIndicesWithKSetBits = function(nums, k) {
    let sum = 0;
    // Helper function to count set bits in an integer's binary representation
    function countSetBits(n) {
        let count = 0;
        while (n) {
            count += n & 1;
            n >>= 1;
        }
        return count;
    }
    // Iterate over the indices of nums
    for (let i = 0; i < nums.length; i++) {
        // Count set bits in the current index
        if (countSetBits(i) === k) {
            // If the number of set bits equals k, add the corresponding element to sum
            sum += nums[i];
        }
    }
    return sum;
};
